    uint public data = 10;
    function x() external pure returns (uint){
        uint newData = 25;
        return newData;
    }
    function l()internal view returns(uint){
        uint newData = data -3;
        return newData;
    }
    function y()public view returns(uint){
        return data;
    }
}
